import PropTypes from 'prop-types'

const InputSearch = ({ query, onUpdate }) => {
  return (
    <div>
      <input className="searchInput" value={ query } onChange={ () => onUpdate(query) } placeholder="Search book" type="text" />
    </div>
  )
}

InputSearch.propTypes = {
  query: PropTypes.string,
  onUpdate: PropTypes.func
}

export default InputSearch
